
/* eslint global-require: "off" */
/* eslint-disable consistent-return */
import axios from 'axios';

const noImageIcon = 'data:image/png;base64,';
const addToCalendarIcon = 'data:image/png;base64,';
const collapseIcon = 'data:image/png;base64,';

const unineImgBig = 'data:image/gif;base64,';

const momentStatic = require('moment');
require('moment/locale/fr');

momentStatic.locale('fr');

const isConnected = async () => {
  try {
    const res = await axios.get('https://google.com');
    if (res.data) {
      return true;
    }
  } catch (e) {
    return false;
  }
};

export {
  noImageIcon,
  unineImgBig,
  addToCalendarIcon,
  momentStatic,
  isConnected,
  collapseIcon,
};
